import React from "react";
import { View, Text, Button, StyleSheet, TouchableOpacity } from "react-native";
import { createStackNavigator } from "@react-navigation/stack";
import BlankOne from "./stackPages/blankOne";
import BlankTwo from "./stackPages/blankTwo";
import BlankThree from "./stackPages/blankThree";
import { TouchableHighlight } from "react-native-gesture-handler";

const SettingsScreen = ({ navigation }) => {
  return (
    <View
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "ffff",
      }}
    >
      <TouchableOpacity
        style={styles.Button1}
        onPress={() => navigation.navigate("Blank1")}
      >
        <Text>Ide gas</Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={styles.Button2}
        onPress={() => navigation.navigate("Blank2")}
      >
        <Text>Ide gas</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.Button3}
        onPress={() => navigation.navigate("Blank3")}
      >
        <Text>Ide gas</Text>
      </TouchableOpacity>
    </View>
  );
};

const Stack = createStackNavigator();
export default function StackNavigator() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Settings" component={SettingsScreen} />
      <Stack.Screen name="Blank1" component={BlankOne} />
      <Stack.Screen name="Blank2" component={BlankTwo} />
      <Stack.Screen name="Blank3" component={BlankThree} />
    </Stack.Navigator>
  );
}

const styles = StyleSheet.create({
  Button1: {
    color: "black",
    alignItems: "center",
    marginBottom: 20,
    backgroundColor: "red",
  },
  Button2: {
    color: "black",
    alignItems: "center",
    marginBottom: 20,
    backgroundColor: "red",
  },
  Button3: {
    color: "black",
    alignItems: "center",
    marginBottom: 20,
    backgroundColor: "red",
  },
});
